import React from 'react';
import './main.css';
import './App.css';
import { Component } from 'react';
import { BrowserRouter,Route,Routes} from 'react-router-dom';
import Home from './pages/Home';
class App extends Component {
 render(){
  return (
    <div>
    <BrowserRouter>
    <Routes>
     <Route path='/' exact Component={Home}  />

     </Routes>

    </BrowserRouter>
    </div>



  )
 }

}

export default App;
